import './App.css';
import React, { useState, useEffect} from 'react';
import LoadingScreen from './components/resources/LoadingScreen.jsx';

import GameDetail from './components/mainCards/GameDetail.jsx'; 
import GameStats from './components/mainCards/GameStats';
import PlayerStatsGameDetail from './components/mainCards/PlayerStatsGameDetail.jsx';
import TeamStatsDetail from './components/mainCards/TeamStatsDetail';

function App() {
  const [ error, setError ] = useState(null);
  const [ data, setData ] = useState([]);
  const [ loaded, setLoaded ] = useState(false);

  useEffect(() => {
    fetch("https://htxrockets.com/api/archived-game/0022101142")
    .then( (res) => res.json() )
    .then( 
      (res) => {
        setData(res.q);
        setLoaded(true);
        console.log(res);
      },
      // Note: handling errors here
      // instead of a catch() block so that we don't swallow
      // exceptions from actual bugs in components.
      (error) => { 
        setLoaded(true);
        setError(error);
        console.log(error);
      }
    );
  }, [])

  if (error) {
    return <div>Error: {error.message}</div>;
  } else if (!loaded) {
    return <div className="loading-page">
        <LoadingScreen />
      </div>;
  } else {
    return (
      <div>
        <GameDetail props={data} />
        <div>
          <h3>***** Last Play Block *****</h3>
        </div>
        {/* Tab links */}
        <div class="tab">
          <button class="tablinks" onclick="openTab(event, 'game-stats')">Game Stats</button>
          <button class="tablinks" onclick="openTab(event, 'player-stats')">Player Stats</button>
          <button class="tablinks" onclick="openTab(event, 'team-stats')">Team Stats</button>
        </div>
        {/* Tab content */}
        <div id="game-stats" class="tabcontent">
          <GameStats />
        </div>

        <div id="player-stats" class="tabcontent">
          <PlayerStatsGameDetail />
        </div>

        <div id="team-stats" class="tabcontent">
          <TeamStatsDetail />
        </div>




        <div className="table">
          <table>
            <thead>
            </thead>
            <tbody></tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default App;
